  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Bombay
  Hook National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, fish, reptiles, and diseases- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. Resource
  management is outlined; topics include fur harvesting and commercial fishing. A
  progress report on field investigations and applied research is also provided. The
  public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, and hunting. Photographs, newspaper articles, and a wilderness
  study summary are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
